b = input ('Digite b: ')
c = input ('Digite c: ')

if a<(b+c):
    print('S')

    if (a**2) == (b**2+c**2):
        print('Re')
    elif a**2 > b**2+c**2:
        print ('Ob')
    else:
        print ('Ac')

    if a==b==c:
        print('Eq')
    elif b==c!=a:
        print('Is')
    else:
        print('Es')
else:
    print('N')

