c=input('Digite o valor de c:')
if a<b+c and b<a+c and c<b+a:
    print('S')
    if (a*a)==(b*b)+(c*c) or (b*b)==(a*a)+(c*c) or (c*c)==(a*a)+(b*b):
        print('Re')
