            print('Is')
        elif a!=b and a!=c and b!=c:
            print('Es')
    elif (a*a)>(b*b)+(c*c) or (b*b)>(a*a)+(c*c) or (c*c)>(a*a)+(b*b):
        print('Ob')
        if (a==b)and (a==c):
            print('Eq')
        elif (a==b and a!=c) or (b==c and b!=a) or (c==a and c!=b):
            print('Is')
        elif a!=b and a!=c and b!=c:
            print('Es')
    elif (a*a)<(b*b)+(c*c) or (b*b)<(a*a)+(c*c) or (c*c)<(a*a)+(b*b):
        print('Ac')
        if (a==b)and (a==c):
            print('Eq')
        elif (a==b and a!=c) or (b==c and b!=a) or (c==a and c!=b):
            print('Is')
        elif a!=b and a!=c and b!=c:
            print('Es')

else:
    print('N')

